import React from "react";

const Posts = ({ posts }) => {
  return posts.map((posts, index) => {
    return (
      <div key={index}>
        <h1>{posts.title}</h1>
        <h2>{posts.description}</h2>
      </div>
    );
  });
};

export default Posts;
